  "Allegations" : "RUSSELL ANDREW LABRASCA VIOLATED EXCHANGE RULE 408(A) IN THAT HE EFFECTED DISCRETIONARY TRANSACTIONS IN THE ACCOUNTS OF CUSTOMERS OF HIS MEMBER ORGANIZATION EMPLOYER WITHOUT FIRST OBTAINING THE WRITTEN AUTHORIZATION OF THE CUSTOMERS; (B) VIOLATED EXCHANGE RULE 724(A) IN THAT HE EFFECTED DISCRETIONARY OPTION TRANSACTIONS IN THE ACCOUNTS OF OF CUSTOMERS OF HIS MEMBER ORGANIZATIONS EMPLOYER WITHOUT FIRST OBTAINING THE WRITTEN AUTHORIZATION OF THE CUSTOMERS (C) VIOLATED EXCHANGE RULE 353(A) IN THAT HE PAID AN INDIVIUAL A PERCENTAGE OF COMMISSIONS EARNED IN ACCOUNTS FOR HAVING PROCURED CUSTOMERS FOR HIM; (D) VIOLATED EXCHANGE RULE 346(B) IN THAT HE RECIEVED COMPENSATION IN CONNECTION WITH A SECURITIES TRANSACTION WITHOUT THE WRITTEN CONSENT OF HIS MEMBER ORGANIZATION EMPLOYER; AND (E) ENGAGED IN CONDUCT INCONSISTENT WITH JUST AND EQUITABLE PRINCIPALS OF TRADE IN THAT (1) HE SOLD AND/OR SOLD ASSISTED THE SALE TO A CUSTOMER OF CUSTOMER'S STATE, USING A FALSE ADDRESS FOR THE CUSTOMER; (2) HE MADE REPRESENTATIONS REGARDING PAST AND FUTURE PERFORMANCE OF A COVERED OPTION WRITING PROGRAM TO CUSTOMERS OF HIS MEMBER ORGANIZATIN EMPLOYER THAT DID NOT FULLY COMPLY WITH THE STANDARDS OF THEN EXCHANGE RULE 474.A10(3) HE MADE REPRESENTATIONS REGARDING PAST AND FUTURE PERFORMANCE OF A COVERED OPTION WRITING PROGRAM TO CUSTOMERS OF HIS ORGANIZATION EMPLOYER THAT DID NOT FULLY COMPLY WITH THE STANDARDS OF THEN EXCHANGE RULE 474A.10(5); AND (4) HE MADE MISREPRESENTATIONS REGARDING FUTURE PROFITABILITY OF A COVERED OPTION WRITING PROGRAM TO CUSTOMERS OF HIS MEMBER ORAGANIZATION EMPLOYER.",
