  "Sanction Details" : "THE BOARD, IN ACCEPTING THE CONSENT, FINDS MR. LABRASCA GUILTY AS SET FORTH IN THE CONSENT. THE BOARD FURTHER IMPOSES THE PENALTY CONSENTED TO OF A CENSURE; A SUSPENSION FROM ANY EMPLOYMENT OR ASSOCIATION WITH ANY MEMBER OR MEMBER ORGANIZATION FOR A PERIOD OF 60 DAYS; A FINE OF $25,000; AND AN UNDERTAKING THAT LABRASCA WILL HAVE NO SUPERVISORY RESPONSIBILITY OVER ACCOUNT EXECUTIVES,  BRANCH MANAGERS OR OTHER RETAIL SALES PERSONNEL FOR A PERIOD OF ONE YEAR FOLLOWING THE CONCLUSION OF HIS 60-DAY SUSPENSION. D-NYSE-89-109 HPD 88-47, DATED 12/5/89. ",
